        <div className="">
          <i class="fa-solid fa-bars"></i>
        </div>
        {/*Logo */}
        <div className="">HANDO</div>
        <div className="">
          <input type="text" />
          <i class="fa-regular fa-bell"></i>
          <i class="fa-solid fa-gear"></i>
          <button>Login</button>
        </div>
      </div>
    </div>
  );
};
export default Header;
